import React, { Component } from 'react';
import './Contact.css';

class Contact extends Component {
  render() {
    return(
      <div class="contact">
        <h4 className="info-label"> e-mail</h4>
        <p>ana.dejanovich@gmail.com</p>
        <h4 className="info-label"> social media</h4>
        <div class="fa-icons">
          <a href="https://www.instagram.com/anushka.draws">
            <i class="fa fa-instagram fa-2x"></i>
          </a> 
          <a href="https://www.facebook.com/PeculiarGardener/">
            <i class="fa fa-leaf fa-2x"></i>
          </a>
          <a href="https://www.behance.net/anadejanovic">
            <i class="fa fa-behance fa-2x"></i>
          </a> 
        </div>
      </div>
    );
  }
}

export default Contact;
